export function getUsers(){
  const options = {
    method: "GET",
    headers: {
      "Authorization": "Basic YWRtaW46YWRtaW4=",
      "Content-Type": "application/json",
    },
  }

  async function httpRequest(){
    return await fetch("http://localhost:8080/usuarios/todos-os-usuarios", options).then(response => response.json());
  };

  return httpRequest();
}
